import React, { Component } from "react";
import "../App.css";
import { makeStyles } from "@material-ui/core/styles";
import GridList from "@material-ui/core/GridList";
import GridListTile from "@material-ui/core/GridListTile";
import GridListTileBar from "@material-ui/core/GridListTileBar";
import IconButton from "@material-ui/core/IconButton";
import FullscreenIcon from "@material-ui/icons/Fullscreen";

import image1 from "../resources/image1.jpg";
import image2 from "../resources/image3.jpg";
import image3 from "../resources/image4.jpg";
import image4 from "../resources/image6.jpg";
import image5 from "../resources/image7.jpg";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    flexWrap: "wrap",
    justifyContent: "space-around",
    overflow: "hidden",
    "margin-top": "10%",
    backgroundColor: theme.palette.background.paper,
  },
  gridList: {
    width: 1000,
    height: 650,
    // Promote the list into his own layer on Chrome. This cost memory but helps keeping high FPS.
    transform: "translateZ(0)",
  },
  titleBar: {
    background:
      "linear-gradient(to bottom, rgba(0,0,0,0.7) 0%, " +
      "rgba(0,0,0,0.3) 70%, rgba(0,0,0,0) 100%)",
  },
  icon: {
    color: "white",
  },
}));
const tileData = [
  { img: image1, title: "Image1", author: "author", featured: false },
  { img: image2, title: "Image2", author: "author", featured: false },
  { img: image3, title: "Image3", author: "author", featured: false },
  { img: image4, title: "Image4", author: "author", featured: false },
  { img: image5, title: "Image5", author: "author", featured: false },
];
export default function Images() {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <GridList cellHeight={300} className={classes.gridList} cols={3}>
        {tileData.map((tile) => (
          <GridListTile key={tile.img} cols={tile.cols || 1}>
            <img src={tile.img} alt={tile.title} />
          </GridListTile>
        ))}
      </GridList>
    </div>
  );
}
